import React, { useState } from 'react';
import './MedicationAlert.css';

const MedicationAlert = () => {
  const [medications, setMedications] = useState([
    { name: '소염 진통제', period: '04.25~04.29', times: '08:00/ 12:00/ 18:00', active: true },
    { name: '해열제', period: '04.25~05.01', times: '08:00/ 12:00/ 18:00', active: true },
    { name: '스프레이', period: '04.25~05.01', times: '08:00/ 12:00/ 18:00', active: true },
    { name: '항생제', period: '04.25~05.01', times: '08:00/ 12:00/ 18:00', active: true }
  ]);

  const handleAddMedication = () => {
    setMedications([...medications, { name: '', period: '', times: '', active: false }]);
  };

  const handleRemoveMedication = (index) => {
    setMedications(medications.filter((_, i) => i !== index));
  };

  const handleToggleActive = (index) => {
    setMedications(
      medications.map((med, i) => (i === index ? { ...med, active: !med.active } : med))
    );
  };

  const handleChange = (index, key, value) => {
    setMedications(
      medications.map((med, i) => (i === index ? { ...med, [key]: value } : med))
    );
  };

  return (
    <div className="medication-alert">
      <header className="medication-alert-header">
        <h1>복약 및 처방할 치료제 목록</h1>
        <button className="add-medication-button" onClick={handleAddMedication}>
          <i className="fas fa-plus"></i> 처방 약품 추가
        </button>
      </header>
      <table className="medication-table">
        <thead>
          <tr>
            <th>약품명</th>
            <th>복용 기간</th>
            <th>알람 시간</th>
            <th>활성화</th>
            <th>삭제</th>
          </tr>
        </thead>
        <tbody>
          {medications.map((med, index) => (
            <tr key={index}>
              <td>
                <input
                  type="text"
                  value={med.name}
                  onChange={(e) => handleChange(index, 'name', e.target.value)}
                />
              </td>
              <td>
                <input
                  type="text"
                  value={med.period}
                  onChange={(e) => handleChange(index, 'period', e.target.value)}
                />
              </td>
              <td>
                <input
                  type="text"
                  value={med.times}
                  onChange={(e) => handleChange(index, 'times', e.target.value)}
                />
              </td>
              <td>
                <button onClick={() => handleToggleActive(index)}>
                  {med.active ? (
                    <i className="fas fa-bell"></i>
                  ) : (
                    <i className="fas fa-bell-slash"></i>
                  )}
                </button>
              </td>
              <td>
                <button onClick={() => handleRemoveMedication(index)}>
                  <i className="fas fa-trash"></i>
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
      <div className="medication-alert-footer">
        <button className="cancel-button">취소하기</button>
        <button className="save-button">저장하기</button>
      </div>
    </div>
  );
};

export default MedicationAlert;
